// import Setting from './Setting'
import Loading from './Components/Loading'
import {useState} from 'react'
import {useAuth0} from '@auth0/auth0-react'
import HomepageRightBody from './HomepageRightBody'
import HeaderAndSideBar from './HeaderAndSideBar'
import Profile from './Components/Profile'
import {
    BrowserRouter as Router,
    Switch,
    Route,
} from 'react-router-dom'

export default function Homepage() {
    const [clickPhoto,setClickPhoto] = useState()
    const [onClick,setOnClick] = useState(false)
    const [queueOnClick,setQueueOnClick] = useState(false)
    const [uploadOnClick,setUploadOnClick] = useState(false)
    const [navBarState,setNavBarState] = useState(false)
    const [clickGallery,setClickGallery] = useState(false)
    const {isLoading} = useAuth0()

    if (isLoading) {
        return <Loading />
    }

    return (
        <Router>
            <Switch>
                <Route path="/" exact>
                        <HeaderAndSideBar onClick={onClick} setOnClick={setOnClick} 
                        navBarState={navBarState} setNavBarState={setNavBarState} 
                        setClickGallery={setClickGallery}/>
                        <HomepageRightBody onClick={onClick} setOnClick={setOnClick}
                        clickGallery={clickGallery} setClickGallery={setClickGallery}/>
                </Route>
                <Route path="/profile" exact>
                        <HeaderAndSideBar onClick={onClick} setOnClick={setOnClick} 
                        navBarState={navBarState} setNavBarState={setNavBarState}/>
                        <Profile clickGallery={clickGallery} setClickGallery={setClickGallery}/>
                </Route>
            </Switch>
        </Router>

        //  <span className="grid-container">
