        //     <div className="grid-item">
        //         <Mapping onClick={onClick} setOnClick={setOnClick}/>
        //         <PhotoDisplay clickPhoto={clickPhoto} onClick={onClick} setOnClick={setOnClick}/>
        //     </div>
        //     <div className="grid-item">
        //         <CarStatus/>
